import React, { Component } from 'react';

interface HeaderProps {
    name : string;
}

class Menu extends Component<HeaderProps, {}> {
    render() {
        return (
            <a>
                <span>{this.props.name}</span>
            </a>
        )
    }
}

export default Menu;
